import React from 'react';
import './App.css';
import LogIn from "./component/LogIn"
const page = (value)=>{
  switch(value){
    case true:
      return <LogIn/>
    case false:
      return 0
  };
};
function App() {
  return (
    <div className="App">
      <button onClick={e=>page(true)}>LogIn</button>


    </div>
  );
}

export default App;
